class Solution(object):
    def beautifulSubstrings(self, s, k):
        """
        :type s: str
        :type k: int
        :rtype: int
        """
        def is_vowel(ch):
            return ch in 'aeiou'

        def check_beautiful(v, c):
            return v == c and (v * c) % k == 0

        n = len(s)
        count = 0

        for i in range(n):
            vowels = consonants = 0
            for j in range(i, n):
                if is_vowel(s[j]):
                    vowels += 1
                else:
                    consonants += 1
                if check_beautiful(vowels, consonants):
                    count += 1

        return count
